import React from 'react';
import Feature from './Feature'









const LevelFeature = ({level, levelFeatures}) => {

	return (
		<div>
			<h1> Level: {level} </h1>
			<Feature levelFeatures={levelFeatures}/>
		</div>

	);

}

export default LevelFeature;



